Head.
In full-face view sub-rectangular, slightly widening posteriorly, with lateral sides slightly convex (
Fig. 13B
). In lateral view sub-oval, not depressed posteriorly; ventral and dorsal margins convex; inner hypostomal tooth not visible. Side of head with dense, long, suberect to erect pilosity; head dorsum with relatively dense, long, suberect to erect pilosity. Medial frons with sparse and thick costulae; interspaces between costulae indistinctly punctate. Frons laterally with thick and sparse rugae; interspaces between rugae distinctly punctate. Occipital lobes punctate with sparse and indistinct rugae. Gena with dense and moderately thick costulae; interspaces between costulae mostly punctate. Sides posterolateral from eyes microreticulate with additional network of thin and sparse rugulae. Center of clypeus shiny with weakly developed rugulae, lateral sides with distinct rugulae; median notch present, moderately wide and shallow; median longitudinal carina present; lateral longitudinal carinae present. Scape, when laid back, exceeding the midlength of head by one-fifth of its length; pilosity subdecumbent to erect (
Fig. 13B, D
). Inner hypostomal tooth distinct, bulge-like; outer hypostomal tooth lobe-like, moderately high and wide,, with top arching posterolaterally; median tooth absent (
Fig. 27E
). 
Mesosoma.
In lateral view, promesonotum short, angular, and moderately low; posterior mesonotum smoothly declining towards propodeum; mesonotal process indistinct and tubercle-like; promesonotal groove absent; metanotal groove indistinct; propodeal spines moderately long with moderately wide base and acute top; humeral tubercle weakly produced (
Fig. 13D
). Surface microreticulate; lateral sides of pronotum, propodeum, and katepisternum with additional thin and transverse rugae. Pilosity dense, long, and erect (
Fig. 13D, F
). 
Gaster.
Shiny and smooth; pilosity moderately sparse, long, and erect (
Fig. 13D, F
). 
Color.
Yellowish orange to brown, antennae and legs yellow (
Fig. 13D, F
).

Head.
In full-face view oval, posterior region not elongated; nuchal collar weakly developed (
Fig. 13A
). Pilosity relatively sparse, moderately long, subdecumbent to erect. Sculpture distinctly to indistinctly punctate, fading posteriorly; vertex and gena mostly or entirely smooth. Clypeus with median longitudinal carina absent; two lateral longitudinal carinae absent. Scape, when laid back, exceeding the posterior head margin by two-fifths of its length; pilosity dense, subdecumbent to erect (
Fig. 13A, C
). 
Mesosoma.
In lateral view, promesonotum moderately low and moderately long and arched; promesonotal groove present; metanotal groove distinct; propodeal spines very small to small, thin, and triangular (
Fig. 13C
). Sculpture punctate. Pilosity sparse, long, and erect (
Fig. 13C, E
). 
Gaster.
With sparse and erect pilosity (
Fig. 13C, E
). 
Color.
Yellow to brown, legs and antennae usually brighter than the rest of the body (
Fig. 13C, E
).
